import './App.css';
import LogoutButton from './components/LogoutButton'
import Home from './components/Home'
import LoginButton from './components/LoginButton';
import { useAuth0 } from '@auth0/auth0-react';

function App() {

  const { user, isAuthenticated } = useAuth0();

  return (

    isAuthenticated && (
      <div>
        <LogoutButton />
        <Home />


      </div>
    )
  );
}

export default App;
